import './Launch.css';
import logo from './imgs/VoterAppQR.png';
import instagram from './imgs/instagram.png';
import facebook from './imgs/facebook.png';
import twitter from './imgs/twitter.png';
function Extras() {
    return<>

    <div>
        <img src={instagram} className="images"></img>
        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <img src={facebook} className="images"></img>
        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <img src={twitter} className="images"></img>

    </div>

    <div class="extras" style={{display:'flex'}}>

    <div>
        <div style={{fontSize:20}}>Voter Helpline Number</div>
            <p style={{color:'blue',fontSize:20}}>1950</p>

            <img src={logo} style={{width:120,height:120}}></img>
            <br/>
        <br/>
        <div style={{fontFamily:"monospace"}}> Download Voter Helpline<br/>
              with Given QR
        </div>
    </div>


    </div>
        </>
}

export default Extras;
